import React from 'react'

const StudentData = (prop) => {
  return (
    <div>
      <h1>{prop.data.Name}</h1>
      <h1>{prop.data.id}</h1>
      <h1>{prop.data.class}</h1>
    </div>
  )
}

export default StudentData
